import React     from 'react'
import Book      from '../Components/Book'
import ListBooks from '../Data/ListBooks'

const books = _ => {
    const listBooks = ListBooks.map((book) => {
        return (
            <Book title={book.title} id={book.id} />
        )
    })
    return (
       <ul>
           { listBooks }
       </ul> 
    )
}

export default books
